(37, 'RyigFH', 'ABOUT AXESPRIME', 'AXES PRIME is permitted by the FSA of SVG in 2021 to act as a financial and monetary intermediary in the conduct of financial and monetary brokerage business for the sale and purchase of currencies and intermediating in money marked transactions and as permitted with granted company number 678 SVG.', '2021-06-09 17:55:52', '2021-06-15 18:03:07'),
(38, 'MDY58B', 'Our Mission', 'AxesPrime is committed to provide secured, as well as beneficial, trading environment for its traders and investors in the global forex industry. Our goal is to carry out advanced solutions to further improve the quality of online forex trading.\r\n\r\nWe are determined to connect with our clients, and make the industry even better by means of our cutting-edge technologies and sophisticated financial tools. AxesPrime help customers expertly handle and expand their portfolio in the forex industry.\r\n\r\nOur main priority and dedication is to our clients and partners. We aspire to build and keep a high level of customer support so as to present the services suitable for our customers.', '2021-06-09 17:58:27', '2021-06-09 17:59:00'),
(39, '3y2b3j', 'Reliable Trading Solutions', 'AxesPrime takes pride in the level of the trading systems and solutions it is offering to its clients and partners around the world. Our every move is centered on setting up the most effective and low latency performance, keeping our clients one step ahead of the competition at the same time providing them unparalleled and excellent service.\r\n\r\nSince the establishment of our company, we have been dedicated to continuously upgrade our software and internal infrastructure so as to maintain the upper hand in providing service that would best please our clients.', '2021-06-09 17:59:26', '2021-06-09 17:59:26'),
(40, 'ro9o3r', 'Superb Trading Conditions', 'AxesPrime keeps pace with the advancement of the forex industry, and our team’s range of effective ideas puts a great deal of value market inquiry, trading various assets with the lowest market-price differences possible.\r\n\r\nThe TEACH account that we offer is particularly modified to meet the requirements of a specific type of trader. \r\n\r\nWe would like to provide as much versatility as possible for our customers, as our accounts have the most helpful features and benefits accessible to us.\r\n\r\nFurthermore, we make an effort to secure our clients’ investment by primarily keeping all their funds unattached from the company’s assets. Hence, your funds are protected at all times even if the business comes across serious financial issues.', '2021-06-09 17:59:57', '2021-06-09 17:59:57');
